USE xtdb;

DROP TABLE IF EXISTS Donhang;
CREATE TABLE Donhang (
    DonhangID   INTEGER IDENTITY(1,1) NOT NULL PRIMARY KEY,
    KhachhangID INT,
    NhanvienID  INT,
    Ngaydathang DATE,
    ShipperID   INT
);

DROP TABLE IF EXISTS Danhmuc;
CREATE TABLE Danhmuc (
    DanhmucID  INTEGER  IDENTITY(1,1) NOT NULL PRIMARY KEY,
    TenDanhMuc nvarchar(255),
    MoTa       nvarchar(255) 
);


DROP TABLE IF EXISTS Cungcap;
CREATE TABLE Cungcap (
    CungcapID INTEGER  IDENTITY(1,1) NOT NULL PRIMARY KEY,
    Tendaydu  nvarchar (255),
    TenLienhe nvarchar (255),
    Diachi    nvarchar (255),
    Thanhpho  nvarchar (255),
    MaBuudien nvarchar (255),
    Quocgia   nvarchar (255),
    Dienthoai nvarchar (255) 
);

-- Sanpham
DROP TABLE IF EXISTS Sanpham;
CREATE TABLE Sanpham (
    SanphamID  INTEGER IDENTITY(1,1) NOT NULL PRIMARY KEY,
    TenSanpham nvarchar (255),
    CungcapID  INT,
    DanhmucID  INT,
    Donvi      nvarchar (255),
    Gia        DECIMAL(13, 2)
);

DROP TABLE IF EXISTS DonhangChitiet;
CREATE TABLE DonhangChitiet (
    DonhangChitietID INTEGER IDENTITY(1,1) NOT NULL PRIMARY KEY,
    DonhangID        INT,
    SanphamID        INT,
    Soluong          INT
);


DROP TABLE IF EXISTS Khachhang;
CREATE TABLE Khachhang (
    KhachhangID INTEGER  IDENTITY(1,1) NOT NULL PRIMARY KEY,
    HoTen       nvarchar (255),
    TenLienLac  nvarchar (255),
    Diachi      nvarchar (255),
    Thanhpho    nvarchar (255),
    MaBuudien   nvarchar (255),
    QuocGia     nvarchar (255) 
);
DROP TABLE IF EXISTS Nhanvien;
CREATE TABLE Nhanvien (
    NhanviennID INTEGER IDENTITY(1,1) NOT NULL PRIMARY KEY,
    Ten         nvarchar (255),
    Ho          nvarchar (255),
    NgaySinh    DATE,
    Anh         nvarchar (255),
    Ghichu      Text
);
DROP TABLE IF EXISTS Shippers;
CREATE TABLE Shippers (
    ShipperID   INTEGER  IDENTITY(1,1) NOT NULL PRIMARY KEY,
    Hoten       nvarchar (255),
    Sodienthoai nvarchar (255) 
);

